import React from "react";
import styled from "styled-components";
function StickyFooter() {
  return <Footer>footer</Footer>;
}

export default StickyFooter;

const Footer = styled.div`
  min-height: 60px;
  
  display:flex;
  align-items: center;
  justify-content: space-between;
  padding 0 20px;
  bottom: 0;
  left: 0;
  right: 0;
  z-index: 1;
`;
